import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <div className="home">
      <h3>A blogging website for</h3>
      <h2>EVERYONE</h2>
      <p>
        “There’s a lot of information out there for free, so you’ve got to
        figure out what makes your information different.”
      </p>
    </div>
  );
};

export default Home;
